import React from 'react'
import { Nav, Navbar, Form, FormControl, Button } from 'react-bootstrap'
import styled from 'styled-components'

const Styles = styled.div`
    .container, .parallax, .footer {
        text-color: white
        text-align: center;
        z-index: 0;
    }

    .footer {
        text-align: center;
        background-color: grey;
    }

    .para1 {
        margin: 0px;
        float: left;
    }

    .para2 {
        margin: 0px;
        float: right;
    }

    .para3 {
        margin: 0px;
        float: right;
    }
`

export const Footer = () => {
    return (
        <Styles>
        <Navbar expand="lg" fixed="top">
            <Navbar.Brand href="/">Perfiction</Navbar.Brand>
            <Navbar.Toggle area-controls="basic-navbar-nav"/>
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ml-auto">
                    <Nav.Item><p className="para1">
                    <strong className="otsikot">Perfiction</strong><br/>
                    Roast And Coffee Shop<br/>
                    Lönnrotinkatu 32<br/>
                    00180<br/>
                    HELSINKI<br/>
                    <a href="https://www.facebook.com/groups/2107970076086665/" >Facebook / Cup o'Roast</a><br/>
                </p><Nav.Link href="/">Home</Nav.Link></Nav.Item>
                    <Nav.Item><p className="para2">
                    <strong className="otsikot">INFO</strong><br/>
                    info@cuporoast.cof<br/>
                    +358411234567<br/>
                    Availability on weekdays:<br/>
                    9:00 - 16:00<br/>
                </p></Nav.Item>
                    <Nav.Item><p className="para3">
                    <strong className="otsikot">OPENING HOURS</strong><br/>
                    Coffee shop<br/>
                    open:<br/>
                    Mon - Thu 6:00 - 18:00<br/>
                    Friday 6:00 - 21:00<br/>
                    Sat - Sun 10:00 - 20:00<br/>
                    Welcome!<br/>
                </p></Nav.Item>
                </Nav>
                <Form inline>
                    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                    <Button variant="outline-dark">Search</Button>
                </Form>
            </Navbar.Collapse>
        </Navbar>
    </Styles>
    )
}
